import { getDicts } from '@/api/system/dict';
export default {
  name: 'DictSelect',
  props: {
    value: {
      type: [String, Number],
      default: ''
    },
    size: {
      type: String,
      default: 'mini'
    },
    dictName: {
      type: String,
      default: '',
      require: true
    },
    placeholder: {
      type: String,
      default: ''
    }
  },
  data: function data() {
    return {
      dictList: [],
      dictValue: ''
    };
  },
  watch: {
    value: function value() {
      this.dictValue = this.value + '';
    }
  },
  created: function created() {
    this.dictValue = this.value + '';
    this.getDictList();
  },
  methods: {
    getDictList: function getDictList() {
      var _this = this;
      // 从后台获取字典列表
      getDicts(this.dictName).then(function (response) {
        _this.dictList = response.data;
      });
    },
    change: function change(value) {
      this.$emit('input', value);
    }
  }
};
